INSERT INTO `blogs` VALUES (6,'Children\'s Day','<p>Every child is a gift of nature. Give them their today, give them their time to play, and make way for their future. FBP wishes you all a very Happy Children\'s Day. Keep the child within you alive always.&nbsp;</p>','2023-11-14','2024-01-17 14:07:34.530000','2024-01-17 14:07:43.562000','2024-01-17 14:07:43.559000',1,1,'children-s-day'),(7,'Happy Diwali','<p>May the light of this auspicious celebration sweep the worlds gloom and pollutants away. May millions of lamps illuminate our life with endless joy, prosperity, health and wealth forever. FBP wishes you all and your loved ones a very happy and blessed Diwali!</p>','2023-11-12','2024-01-17 14:09:10.518000','2024-01-17 14:09:13.044000','2024-01-17 14:09:13.040000',1,1,'happy-diwali'),(8,'Happy 8th Year Anniversary','<p>Please join us in wishing our super-talented Vice President Sir, Mr. Dedeep T S, a Happy 8th Year Work Anniversary with FBP.&nbsp;<br>Thank you, Dedeep Sir for all of your hard work and we are so grateful to have you on the team.</p>','2023-11-06','2024-01-17 14:10:27.113000','2024-01-17 14:10:29.455000','2024-01-17 14:10:29.451000',1,1,'happy-8th-year-anniversary'),(9,'Exploring Top Residential Areas In Thane','<p>Located in the northeastern part of Mumbai, Thane as a municipality has a lot to offer to its residents. There are various well-known localities in Thane that have a lot to offer to its residents in terms of infrastructural amenities. It is close to Mumbai and provides its residents a host of amenities. Thane has experienced rapid expansion in recent years and has been the prime focus of the governments development plans. Together with various new projects, a variety of social and infrastructural amenities have been built in the area  like schools, colleges, universities, and multiple hospitals and healthcare centers. It has thus become a hot spot for investment with well-maintained- state-of-the-art highways and train connections to and from the city of Mumbai.</p><p>SOME OF THE HOT SPOTS FOR INVESTMENT IN THANE</p><p>Kolshet Road has emerged as a strong real estate destination in Thane over the last couple of years owing to its great accessibility, comparative affordability, and proximity to business centers.<br>Ghodbunder Road passes through some of the most significant West Thane neighborhoods like Kasarvadavali, Kavesar, Brahmand, Patlipada, and Majiwada.<br>Badlapur is an investment hub in Thane emerging as a significant residential site for investment for real estate developers. Badlapur is well connected by rail and road with Mumbai. This area is known for its affordable housing.<br>Manpada is another sought-after residential area. It is in demand because of a number of good infrastructural initiatives that are underway. These initiatives offer the residents of Manpada a validity of future prosperities and convenience of living experience.<br>Pokhran Road has peaceful, green surroundings and offers a mix of apartment complexes and independent homes. It has good connectivity to other parts of Thane and Mumbai<br>Along with these above-mentioned localities, there are other localities as well that are well under the supervision of potential real estate investment. In conclusion, Thane is an ever-evolving locality that is seeing an extraordinary rate of return on investment on real estate properties. &nbsp;According to the various real estate market trends, Thane has experienced an extraordinary figure of 30% increase in real estate prices in the last couple of years in some of the areas. Therefore, if one is looking to invest in real estate in Thane, the investor should definitely check out the above-mentioned localities for investing and expect a higher ROI from this sister city of Mumbai  Thane.</p><p>&nbsp;</p>','2023-12-26','2024-01-17 14:11:57.777000','2024-01-17 14:12:00.489000','2024-01-17 14:12:00.485000',1,1,'exploring-top-residential-areas-in-thane');
/*!40000 ALTER TABLE `blogs` ENABLE KEYS */;
UNLOCK TABLES;

