INSERT INTO `builders` VALUES (16,'Assetz Builder','<p>Assetz Property Group, established in 2006, is a renowned name in the real estate industry. With a strong commitment to quality and innovation, Assetz Property Group has successfully delivered numerous residential and commercial projects. They are known for their attention to detail and customer satisfaction.</p>','2024-01-10 05:10:07.047000','2024-01-10 05:10:10.064000','2024-01-10 05:10:10.061000',2,2,'assetz-builder'),(17,'Urbanrise','<p>Founded by a visionary team of young and passionate experts from the real estate industry, Urbanrise, one of the best builders in Chennai and Hyderabad, is a promising real estate brand emerging across South India from Indias well-acclaimed Alliance Group.</p><p>With 36 Million Sq.Ft of projects worth Rs.14,000 Crores under execution at different stages, Urbanrise projects are funded byADIA (Abu Dhabi Investment Authority) the worlds largest sovereign fund through Kotak Realty Fund and IndoStar Capital Finance Ltd. Urbanrise offers world-class development coupled with complete transparency in operations and ethical practices which is a new benchmark in the industry.</p><p>Our Vision is to be the Worlds largest real estate developer with annual revenues of $10 Billion by the year 2035. Thus bringing pride to our country that we have conquered yet another industry.</p>','2024-01-10 10:38:08.458000','2024-01-10 10:38:37.717000','2024-01-10 10:38:15.629000',2,2,'urbanrise'),(18,'Adarsh Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Since its inception in 1988, under the visionary leadership of Founder Mr. BM Jayeshankar, <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.adarshdevelopers.com/\">Adarsh Group</a> has experienced phenomenal growth. Started as a humble endeavour, today Adarsh Developers are one of the leading real estate companies in Bengaluru.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Coming to be known now as the innovative creator of a luxurious lifestyle, the group constructed its first residential property in 1996 and after that, there was no looking back. Defining the future of architectural excellence, Adarsh offers an eco-friendly, secure and self-sufficient lifestyle through their numerous Residential and commercial endeavours. Today, Adarsh Developers is a name synonymous with quality.</p>','2024-01-10 15:45:54.340000','2024-01-10 15:46:08.177000','2024-01-10 15:46:08.174000',2,2,'adarsh-group'),(19,'Bhartiya City Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Being primarily engaged in and exports of leather apparel through a listed entity, Bhartiya Group has been ruling the real estate market since its inception in 2006 of business. They believe in the concept of quality construction which makes it to be the perfect design for a good lifestyle.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:0px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Enhancing the quality of life across the world for over 30 years, this builder has seen a fast pace development offering turnkey building solutions. Led by this simple philosophy, the&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://bhartiyacity.com/category/mayors-blog/\">Bhartiya Group</a>&nbsp;is working on a number of projects delivering quality end-to-end construction services from concept to completion, including project management. And hence, this builder is identified as one of the best one delivering the best of all homes. Explore details of&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.homznspace.com/nikoo-homes-4-bhartiya-city-thanisandra-bangalore/\">Phase 5</a>&nbsp;&amp;&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.homznspace.com/leela-residences-bhartiya-city/\">Leela Residency.</a></p>','2024-01-10 15:59:04.891000','2024-01-10 15:59:07.861000','2024-01-10 15:59:07.858000',2,2,'bhartiya-city-group'),(20,'Birla Estate','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.birlaestates.com/\">Birla Estates</a> is the real estate vertical of Century Textiles and Industries Ltd., the over Rs. 8000 crore flagship Company of the B. K. Birla Group of Companies with presence in cement, textiles, rayon yarn, pulp &amp; paper, salt, chemicals and more. Birla Estates will be developing many land parcels that they hold as well as look at joint development/strategic tie-ups across top cities.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We will transform the perception of Indian Real Estate sector by delivering an exceptional experience and creating value, at every level, for every stakeholder.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We will provide an iconic brand experience aligned to our legacy by never compromising on transparency, commitment, quality and superior design.</p>','2024-01-10 16:25:49.901000','2024-01-10 16:25:52.685000','2024-01-10 16:25:52.682000',2,2,'birla-estate'),(21,'Brigade Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In 1986, we began as a team of five, operating out of a small site office on our first project, with our sole focus being property development. Today, we number well over 500 and operate from plush offices across two floors at the prestigious World Trade Center Bangalore.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Our team of <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://www.brigadegroup.com/\">Brigadiers</a>based in several major cities in South India, Dubai and San Franciscowork across a diverse portfolio of domains and projects, and draw upon a national and international pool of professional associates. To date, we have completed over 100 buildings; worked on numerous interesting projects and initiatives, many of which inhabit realms unrelated to our business; and engaged with the community through a variety of CSR initiatives. In the process, we have earned important certifications, won prestigious awards and created urban landmarks.</p>','2024-01-10 16:37:35.613000','2024-01-10 16:37:45.661000','2024-01-10 16:37:45.657000',2,2,'brigade-group'),(22,'Godrej Properties','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Godrej Properties brings the Godrej Group philosophy of innovation, sustainability, and excellence to the real estate industry. Each Godrej Properties development combines a 119year legacy of excellence and trust with a commitment to cutting-edge design and technology. Godrej Properties is currently developing residential, commercial, and township projects spread across approximately 11.89 million square meters in 12 cities.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In the last 3 years,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.godrejproperties.com/\">Godrej Properties</a> has received over 150 awards and recognitions, including the Real Estate Company Of The Year at the Construction Week India Awards 2015, Golden Peacock Award for Sustainability for the year 2015 by the Institute Of Directors (IOD), Most Reliable Builder for 2014 at the CNBC AWAAZ Real Estate Awards 2014, Innovation Leader in Real Estate award at the NDTV Property Awards 2014 and Popular Choice  Developer of the Year award by ET NOW in 2013.</p>','2024-01-10 16:59:24.125000','2024-01-10 16:59:27.753000','2024-01-10 16:59:27.749000',2,2,'godrej-properties'),(23,'Mahindra Lifespaces','<p><a style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(68, 68, 68);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:0px;orphans:2;text-align:start;text-decoration:none;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.mahindralifespaces.com/\">Mahindra Lifespace Developers Ltd</a><span style=\"background-color:rgb(255,255,255);color:rgb(34,34,34);font-family:DidactGothic-Regular;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">., the real estate and infrastructure development business of the $16.5 billion Mahindra Group, is a leader in sustainable urban development, through the creation of residential and integrated large format developments across nine Indian cities  Mumbai, Pune, Nagpur, Gurgaon, Faridabad, Jaipur, Chennai, Hyderabad and Bangalore. The Companys residential &amp; commercial development footprint includes over 0.8 million sqm. (8.3 million sq.ft.) of completed projects and over 1.0 million sq. m. (11.3 million sq. ft.) of ongoing and forthcoming projects.</span></span></p>','2024-01-10 17:12:18.173000','2024-01-10 17:12:23.311000','2024-01-10 17:12:23.307000',2,2,'mahindra-lifespaces'),(24,'Salarpuria Sattva','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Kolkata in the year 1985, witnessed the&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://sattvagroup.in/\">Salarpuria Group</a>&nbsp;embarking on an unending journey of developing superior real estate projects. The group has earned a reputed stature across all its projects sprawling in the residential, retail and commercial projects.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Salarpuria Sattva is striving towards excellence with due support of its team, which is proficient in architecture, facility management, and finance administration.&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.sattvagroup.in/real-estate/\">Salarpuria group</a>&nbsp;has successfully developed many residential, retail and commercial zones which have gratified many Indian and global patrons.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The group has always upheld the values of responsible construction by developing sustainable projects. The feat of responsible constructions has been achieved by due investments in technology up-gradation and management services.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Protecting the ecological balance and conserving energy has been few of the other commendable accomplishments of all the projects developed by the Salarpuria group.</p>','2024-01-10 17:25:04.128000','2024-01-10 17:25:07.048000','2024-01-10 17:25:07.045000',2,2,'salarpuria-sattva'),(25,'Pacifica Builder','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.pacificacompanies.co.in/\">Pacifica</a> forayed into the Indian real estate industry, commencing operations in 2004-05.Continuing its legacy of unique urban structures across varied asset classes, Pacifica has made quite an impression in the minds of investors across the nation. Focusing primarily on the needs of the burgeoning middle class, the group has leveraged its decades-old experience in real estate to ensure better living experience and optimum space allocation in every project.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Our global team of value creators and real estate domain experts have until now, established a robust reputation in the Indian milieu. Our sense of innovation and aesthetics have also transformed the architectural skyline in the urban hemisphere of Ahmedabad, Vadodara, Deesa, Chennai, Hyderabad, Bangalore, and NCR.</p>','2024-01-11 05:33:52.124000','2024-01-11 05:33:57.794000','2024-01-11 05:33:57.790000',2,2,'pacifica-builder'),(26,'Goyal & co','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.goyalco.com/\">Goyal &amp; co.</a> was founded by the late Mr. Rampurshottam Goyal in 1970 in the city of Ahmedabad. A bachelor in civil engineering from Jodhpur University, he started the company with limited means. With his heart set on a long term vision and years of perseverance, he grew Goyal &amp; Co into one of the leading real estate development companies in Western India, both in terms of residential and commercial.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The brand has changed the skyline of Ahmedabad as well as earned the respect of the city with a legacy synonymous with excellence, innovation and transparency. Choicest locations, perfect planning and immaculate implementation have ensured value for money for its customers. Known for delivering beyond the call of duty, Goyal &amp; Co has systematically built on its credibility and goodwill with every project it has launched over the years. Each one being a true testament in innovation, design and construction.</p>','2024-01-11 11:23:26.993000','2024-01-11 11:23:30.409000','2024-01-11 11:23:30.406000',2,2,'goyal-and-co'),(27,'Prestige Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Prestige Group owes its origin to Mr. Razack Sattar, who envisioned a success story waiting to take shape in the retail business in 1956 itself.&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.prestigeconstructions.com/blog/\">Prestige Estates</a>&nbsp;and Properties was set up in 1986 growing swiftly to become the leading property developers in Bangalore.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Prestige Court on K.H. Road in Bangalore set the pace, and with over 190 developments covering 38.5 million sq ft of developable area to its credit, Prestige constructions now house a very large populace residing in South India.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Also, Prestige hosts some of the biggest MNCs in business here with residential, commercial, retail, and hospitality developments on the cards approximating 61.4 million sq. ft. just in the area.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">A presence in the retail sector with Prestige Tech Cloud Park, multiplexes, and malls, Prestige has built for itself a name in property development.</p>','2024-02-06 08:26:40.282000','2024-02-06 08:30:06.445000','2024-02-06 08:26:43.587000',2,2,'prestige-group'),(28,'Provident Housing','<p>Provident Housing Limited ; Established in 2008, Provident Housing Limited is a large-scale community developer, offering the greatest value&nbsp;within the residential segment.&nbsp;The company caters to the diverse residential needs of buyers, with a focus on aspirational home ownership.</p><p>The pioneers in making Premium homes affordable is a 100% subsidiary of Puravankara Projects Limited, one of the real estate majors of India.</p><p>Provident Housing caters to the premium affordable housing segment targeting first time home buyers. We are currently executing three projects at Bangalore and Chennai. The three projects together provide about 6.5 million SFT of living space. The configuration mix is one, two and three bedroom apartments and the basic cost ranges from 17.74 Lakhs to 42.15 Lakhs.</p><p>Provident Housing has launched 9 residential projects, in 4 major Indian cities, touching lives of more than 6500 families. The company has been a recipient of multiple awards over the last few years, including Best Brand of the Year Award 2015.</p>','2024-02-06 12:05:29.172000','2024-02-06 12:05:31.900000','2024-02-06 12:05:31.896000',2,2,'provident-housing'),(29,'DNR group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">DNR group is backed by pharmaceutical conglomerate Micro Labs Ltd. (Micro Labs and its associate companies is a multi-faceted organization with an annual turnover of Rs.1500 crore, including exports that contribute Rs. 450 crore. The organizations most important component,&nbsp; remains its 6000 dedicated employees)</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The core maxim of any civilization is happiness. Through prosperity of being and becoming, DNR Corp partakes in the millennia old wisdom established by our enlightened ancients.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Fluid, Dynamic, Evolving. A venture that creates, regulates and improvises itself constantly, to keep in step with our ever sprawling cities, <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://dnrgroup.in/\">DNR Group</a>s presence has become synonymous with being best in the real estate world.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The key to our work ethic is Innovation and Interaction. Be it information or individual, we are the gardeners, willing and eager to invest loving efforts and energy into the aspiration of the full bloom. Combining a cohesive and consistent Quality Standard with ever vigilant Customer Service, we accomplish the Life Spaces which are breathtaking in attributes.</p>','2024-02-06 12:48:49.817000','2024-02-06 12:48:54.923000','2024-02-06 12:48:54.920000',2,2,'dnr-group'),(30,'Embassy Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Embassy Property Developments Private Limited commenced operations in 1993. Together with our promoters, we have 28 years of experience in real estate development. Embassy has an extensive land bank across the country and has developed close to 30 million square feet of prime commercial, residential and retail space as of March 2012. We also have international operations in Malaysia and Serbia.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Over the last 28 years,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.embassyindia.com/\">Embassy</a>&nbsp;has completed over 5.3 million sqft. of residential spaces. Embassys ongoing residential projects include luxury apartments and integrated townships. Residential projects are also designed to obtain IGBC Green Homes Certifications ratings as part of the efforts for creating sustainable developments.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Companys vision for the future is to leverage its tenant relationships and expand the portfolio of Information Technology space throughout India and internationally, besides focusing on developing residential and retail spaces. We will be developing hospitality projects in the integrated townships and business parks that we develop.</p>','2024-02-07 08:05:00.097000','2024-02-07 08:05:03.797000','2024-02-07 08:05:03.791000',2,2,'embassy-group'),(31,'Rohan Builders','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Rohan Builders (India) Private Limited  a Pune based Builders started in 1993 as a modest but strong, multi-disciplinary Organization, with diverse interests in Infrastructure Development, Industrial Construction.</p><p class=\"Paragraph\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In the real estate space, the Rohan group is known for new concepts in residential development, including innovative design and structure, modern and new amenities, quality construction and timely delivery. Rohan has received DA2 CRISIL rating for Real Estate Development signifying its commitment to delivering quality product. It has real estate operations in Pune and Bangalore.</p><p class=\"Paragraph\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The group also has a substantial presence in the infrastructure segment mainly construction of roads and bridges on BOT or Annuity basis. It has executed projects in Punjab, Rajasthan and Maharashtra.</p><p class=\"Paragraph\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://www.rohanbuilders.com/blog\">Rohan Group</a>&nbsp;also has interests in Agriculture, Renewable Energy, and Information Technology space.</p>','2024-02-07 08:24:22.426000','2024-02-07 08:24:25.634000','2024-02-07 08:24:25.631000',2,2,'rohan-builders'),(32,'Shriram Properties','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Shriram Properties is part of the Shriram Group of companies, an INR 90,000 crore financial conglomerate with a strong presence across East India.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.shriramproperties.com/about-us/\">Shriram Properties</a>&nbsp;was established in 1995 with its headquarters in Bengaluru and is a leading real estate developer with projects in Bengaluru, Chennai, Kolkata, Coimbatore, and Vizag.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">More than 20,000 sq.ft of built-up space, with an additional 12 million sq.ft. close to completion and 45.85 million sq.ft still under development by Shriram Properties. Their projects include apartments, villas, and villaments.</p>','2024-02-07 08:52:44.634000','2024-02-07 08:52:47.036000','2024-02-07 08:52:47.032000',2,2,'shriram-properties'),(33,'TVS Emerald','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">At <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.tvsemerald.com/about-us/\">TVS Emerald</a> we understand the importance of harmony between man and nature. Our homes provide you with not just enough green cover for your lungs, we also use alternative energy. We recycle and reuse in order to reduce our carbon footprint.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We build homes that adhere to the best international practices. To us, quality has to be measurable. We are the first developer in Chennai to get our homes certified by , The Construction Quality Assessment System from Building and Construction Authority (BCA), Singapore.</p>','2024-02-07 09:10:10.094000','2024-02-07 09:10:15.022000','2024-02-07 09:10:15.019000',2,2,'tvs-emerald'),(34,'INDIS Builder','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In its journey spanning a decade, from the handover of its first tower in the year 2011 to its maiden and flagship project  PBEL CITY, till now, <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://indis.co.in/\">INDIS</a> has come a long way. Having successfully launched 3 more major projects in the interim  ONE CITY, VB CITY, and VIVA CITY; INDIS now has about 5,000 customers on board.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">With its continuous efforts in building Engineering capabilities; use of robust technologies, such as the shear wall method of construction; engaging reputed construction partners; collaboration with renowned fund houses; sturdy systems and processes, and its unwavering focus on customer service, INDIS has built its reputation of being progressive; reliable, innovative, and a transparent Real Estate Company.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">With Excellence in Engineering; Constant Innovation and Learning at its core, INDIS is set to cross many more milestones in the coming years.</p>','2024-02-07 09:46:14.371000','2024-02-07 09:46:17.408000','2024-02-07 09:46:17.403000',2,2,'indis-builder'),(35,'Candeur Developers','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">As one of the emerging leaders in the development of residential communities,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://candeurcrescent.com/\">Candeur Developers</a> has quickly established itself as a premier developer of multi-family and residential projects.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We cemented our position in Hyderabad more than 2 years ago with a High Rise Project of 40 floors and we have 2 more projects upcoming in the pipeline. The team is very upbeat about our Hyderabad projects and is overwhelmed by the response we have got so far &amp; will continue to keep striving for excellence and quality in whatever we deliver.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We are one of the leading Real Estate Developers in Bengaluru, having delivered 4 lifestyle projects. We have always ensured that we live up to our commitments and have delivered our projects on time. This explains why the majority of our upcoming projects are being sold majorly through our existing client references.</p>','2024-02-07 12:44:36.291000','2024-02-07 12:44:38.389000','2024-02-07 12:44:38.386000',2,2,'candeur-developers'),(36,'DRA Homes','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">DRA Management has collective industry experience of over 100 years and rich expertise across various functions of real estate development. All of which come together to spell NICE to our customers, employees, vendors, and other stakeholders. From being the harbingers of apartment complex concept in Bangalore to developers of South Indias first-ever township, DRA has proven its expertise and made an indelible mark across the cities of Bangalore, Chennai, Goa, and Mysore</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.drahomes.in/\">DRA</a> delivers Quality &amp; Value leading to the invaluable trust of our clients by maintaining transparency in all our transactions, Applying appropriate and efficient technologies, Monitoring &amp; evaluating processes &amp; procedures continuously, Ensuring timely completion of projects.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">This will be achieved through continual improvement and dedication by our trained team of people.</p>','2024-02-08 08:32:22.748000','2024-02-08 08:32:25.338000','2024-02-08 08:32:25.335000',2,2,'dra-homes'),(37,'Puravankara Builder','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Since its inception in 1975,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.puravankara.com/\">Puravankara</a>&nbsp;has believed that there is only one mantra for success: Quality. This credo combined with uncompromising values, customer-centricity, robust engineering, and transparency in business operations, has placed it among the most preferred real estate brands in both residential and commercial segments.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Company has grown from strength to strength, having successfully completed 36 residential/commercial projects spanning 7.80 million square feet. Currently, it has 29 million square feet of projects under development, with an additional 88 million square feet in projected development over the next 7-10 years. An ISO 9001 certification by DNV in 1998 and a DA2+ rating by CRISIL are a testament to Puravankaras reputation as a real estate developer of the highest quality and reliability standards.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Group commenced operations in Mumbai and has established significant presence in the metropolitan cities of Bangalore, Kochi, Chennai, Coimbatore, Hyderabad, Mysore and overseas in Dubai, Colombo and Saudi-Arabia.</p>','2024-02-08 08:43:18.647000','2024-02-08 08:43:22.205000','2024-02-08 08:43:22.201000',2,2,'puravankara-builder'),(38,'Sumadhura Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://sumadhuragroup.com/\">Sumadhura Infracon Pvt. Ltd.</a> is one of the prominent residential and commercial real estate developers in Bangalore &amp; Hyderabad. One of the most admired and trusted brands, Sumadhura has been growing from strength to strength over the past two decades marking its presence over the skylines of Bengaluru and Hyderabad. Sumadhura so far has delivered over 8 million sft of projects while approximately 16 million sft of projects are under construction and planning stages. From being prominently a residential developer, Sumadhura has expanded its horizons into Commercial, Coliving, Plotted Development and other real estate verticals.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Over the past two decades Sumadhura has delivered more than 45 projects where thousands of happy customers reside. Our projects are built to provide exceptional life experiences, security and value. Sumadhura properties have seen the highest rate of capital appreciation and have given our customers an asset to own for life.</p>','2024-02-08 09:14:05.797000','2024-02-08 09:14:08.239000','2024-02-08 09:14:08.235000',2,2,'sumadhura-group'),(39,'Total Environment','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">At&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://www.totalenvironment.in/\">Total Environment</a>, we are focused on creating spaces that you can be proud of living and working in. Our goal is to combine our professional expertise with cutting-edge technology and an out-of-the-box approach to make living more comfortable, productive and joyous.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We work together as an integrated team  from concept to completion. This high degree of interaction between our design, construction and business development teams ensures that every little detail gets the close attention it deserves.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We combine our design skills with excellent craftsmanship to deliver homes of the highest quality, always striving to design and build the most beautiful homes in the world.</p>','2024-02-08 09:23:16.354000','2024-02-08 09:23:19.977000','2024-02-08 09:23:19.971000',2,2,'total-environment'),(40,'SOBHA Limited','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Founded in the year 1995,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://sobha.com/\">Sobha Limited</a>&nbsp;is one of the largest real estate development company in India. Its a Rs. 22 billion company based out of Bangalore and having projects spread across 13 states and 24 cities.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Sobha Limited is primarily focused on the development of residential and contractual projects. The residential projects range from villas and row houses to plotted development, presidential apartments, luxury, and super luxury apartments. Every Sobha project comes equipped with every major amenity including shopping complex, clubhouse, and swimming pool.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Presently, almost 35 residential projects are under construction aggregating to 27.32 million sq. ft. of space under development. 18.90 million sq. ft. of saleable space in addition to ongoing contractual projects adding up to almost 9.50 million square feet of area.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Sobha&nbsp;has constructed a wide array of structures for prestigious corporate clients most noteworthy being Dell, Institute of Public Enterprises (IPE), Taj Group, Hotel Leela Ventures, Infosys, Bosch, HP, Biocon, Timken and more.</p>','2024-02-09 09:54:15.063000','2024-02-09 09:54:17.715000','2024-02-09 09:54:17.711000',2,2,'sobha-limited'),(41,'Raghava Builder','<p>A professionally managed organisation that commenced as a conglomerate in 1991, Raghava is committed to excellence, quality, and client satisfaction. Our businesses span the sectors of engineering &amp; construction, real estate, infrastructure, and urban development &amp; management. We strive for innovativeness by empowering our teams to create value and attain the highest standards. We endeavour to provide reliable and integrated quality services in order to contribute to the infrastructural growth in India. Recently, we emerged as a real estate company developing and building responsible infrastructure through our practices.</p><p>Raghava is not just a real estate company but also a company that changes peoples lives with world-class homes, superior amenities and above all a magnificent living experience. For us, homes are what make people, families and communities. A home is where great relationships kindle and real happiness lies.</p><p>Our vision, at Raghava, is to make fine living an experience by providing the choicest amenities, highly curated facilities and delivering landmark constructions driven by engineering excellence.</p><p>Our mission is to bring the best of this world to our every project, offer exceptional service, forge lasting relationships with our patrons and stand as a premier real estate company.</p>','2024-02-09 10:38:38.103000','2024-02-09 10:38:43.363000','2024-02-09 10:38:43.360000',2,2,'raghava-builder');
