INSERT INTO `client_feedbacks` VALUES (5,'RUPESH KUMAR','2024-01-15 18:30:00.000000','I have booked my new home at Assetz 63 east with the help of Mr Aman Agrawal. He really helped me like a true guide in selecting my new home. I strongly recommend Fullbasket and specially Mr Aman to anyone who is looking to buy his dream home in Bangalore. ',5,'2024-01-16 13:03:14.372000','2024-01-16 13:03:16.479000','2024-01-16 13:03:16.475000',1,1,'rupesh-kumar'),(6,'ANSHU BANSAL','2024-01-15 18:30:00.000000','Ive taken services from Full bAsket for my flat purchase in sarjapur. Mr. Aman was very responsive & professional while dealing with me and he was able to get me the best rate in the market and a steal deal. I recommend taking services from Full Basket. Thank you Aman, you are an asset to your team.',5,'2024-01-16 13:04:25.643000','2024-01-16 13:04:27.652000','2024-01-16 13:04:27.647000',1,1,'anshu-bansal'),(7,'Renju George','2024-01-15 18:30:00.000000','We recently booked an apartment through full basket.Aman was very helpful and professional.\n\nThank you for helping us make the right choice',5,'2024-01-16 13:05:19.302000','2024-01-16 13:05:28.178000','2024-01-16 13:05:28.173000',1,1,'renju-george'),(8,'Jyotsna Toshniwal','2024-01-15 18:30:00.000000','Aman Agarwal from Full Basket was very helpful in finding me a perfect house. He was very patient with constant change in preferences and  requirements. He is very prompt in response and got us a very good deal.\nThank you Aman!',4,'2024-01-16 13:05:57.028000','2024-01-16 13:05:59.153000','2024-01-16 13:05:59.150000',1,1,'jyotsna-toshniwal');
