nt marked with Corner Stones.</p>'),(382,'Security','<p>Elevated Compound Wall Along The Project Boundary<br>24/7 security with CCTV surveillance at major vantage points</p>'),(383,'Green Features','<p>Landscaped Parks and open spaces.<br>Lighting fixtures with cables in landscaped parks.<br>Streetside Landscape as per design.</p>'),(384,'Energy and Power','<p>HT works, LT works, Feeder pillars, and RMUs for power supply  Capacity &amp; Locations as per design.<br>Underground cabling network in the layout with power cable terminated at each plot (power allocation as per design requirements)<br>Street light Cabling, poles with electrical fixtures on either side/one side as per design.</p>'),(385,'Plumbing & Water Conservation','<p>Underground Water supply pipelines from the Overhead tank servicing each plot, as per design requirement.<br>Overall layout Underground Sump &amp; Overhead tank Storage capacity &amp; supply as per Design calculations.<br>Water Supply pipeline for externally sourced water/municipal water (as available).<br>Water Treatment Plant as per design with rainwater harvesting.<br>Sewage treatment plant of required capacity, located as per design.</p>'),(386,'Structure','<p>RCC framed structure Building.<br>Concrete Solid Block Masonry (Int &amp; Ext)  200MM Exterior walls, 100MM Interior walls.</p>'),(387,'Flooring','<p>Marble flooring in the Foyer, Living, Dining, Corridors and all Bedrooms.<br>Anti-skid Ceramic Tiles in Balconies.</p>'),(388,'Doors','<p>Main Door  8 Feet High Opening with Pre-Moulded Flush Shutter &amp; Frame in Wood and Polish on Both Sides.<br>Internal Doors  7 Feet High Opening with Wooden Frames and Flush Shutters.<br>External Doors  UPVC Frames and Sliding Shutters.</p>'),(389,'Plumbing and Sanitary','<p>All Toilets will have EWCs and Chrome Plated Fittings.<br>Chrome Plated Tap with Shower Mixer.<br>Granite Counter with Ceramic Wash Basin in the Master Toilet and Pedestal Wash Basins in Other Toilets.<br>Rainwater Harvesting