 bedroom.<br>100% DG backup power for lifts, pumps &amp; lighting in common areas. Classic 3 BHK/Premium 4 BHK  1.5kW, Smart 3 BHK/Smart 2 BHK  1kW, Smart 1 BHK  0.5kW.</p>'),(398,'Structure','<p>RCC framed structure Building.<br>Concrete Solid Block Masonry (Int &amp; Ext)  200MM Exterior walls, 100MM Interior walls.</p>'),(399,'Flooring','<p>Marble flooring in the Foyer, Living, Dining, Corridors, and all Bedrooms.<br>Anti-skid Ceramic Tiles in Balconies.</p>'),(400,'Doors','<p>Main Door  8 Feet High Opening with Pre-Moulded Flush Shutter &amp; Frame in Wood and Polish on Both Sides.<br>Internal Doors  7 Feet High Opening with Wooden Frames and Flush Shutters.<br>External Doors  UPVC Frames and Sliding Shutters.</p>'),(401,'Plumbing and Sanitary','<p>All Toilets will have EWCs and Chrome Plated Fittings.<br>Chrome Plated Tap with Shower Mixer.<br>Granite Counter with Ceramic Wash Basin in the Master Toilet and Pedestal Wash Basins in Other Toilets.<br>Rainwater Harvesting drain pipes included.</p>'),(402,'Security','<p>Suitable Size and Capacity Passenger and Service Lifts in Every Block.<br>Round-the-clock security with intercom facility.<br>CCTV Cameras at all vantage points.</p>'),(403,'Electrical','<p>Grid Power from BESCOM for each home.<br>Modular switches of reputed make.<br>Copper electrical wiring all throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps.</p>'),(404,'Structure','<p>RCC frame structure with masonry partitions.<br>High quality exposed brick masonry using specially procured high-strength terracotta wire-cut bricks / stone masonry.<br>Internal walls: terracotta blocks, table molded brick masonry or Aerocon blocks / Concrete block masonry.</p>'),(405,'Flooring','<p>Beige colored imported marble laid with paper joints.<br>Kota stone laid with paper joints and finished with 8 coats polish.<br>Cut-pile carpet.<br>Imported marble on the floor and counter, Marazzi or equivalent tiles on the walls up to 7 in