ted make in all toilets.<br>Chromium-plated fittings in all toilets of premium make.<br>Rainwater Harvesting drain pipes included.</p>'),(438,'Security','<p>Reputed quality automatic lifts of 3 nos. in each wing.<br>Round the clock security with intercom facility<br>CCTV Camera at all vantage points.</p>'),(439,'Electrical','<p>Grid Power of 6-8KW from BESCOM for each home<br>Modular switches of reputed premium make<br>Copper electrical wiring all throughout via concealed conduits<br>100% Power backup for elevators, common areas &amp; pumps and 3KW backup for all apartments.</p>');
