INSERT INTO `properties` VALUES (28,'<p>Assetz Bloom &amp; Dell is the new premium residential apartment project in Whitefield Extension just off Whitefield  Hoskote Road, East Bangalore.</p><p>This premium residential enclave, also known as Assetz Codename The Retreat is spread across over 7 acres of prime land in Whitefield Extension at the heart of East Bangalore, featuring the best in Assetz Properties luxury living segment. The project offers 3 BHK Carbon Healing Homes with luxurious amenities and facilities.</p><p>Located right off Whitefield  Hoskote Road, Assetz Bloom and Dell is just 15-20 mins away from the Major IT and Business hubs of Whitefield and ITPL with Old Madras Road, KR Puram, and Hoodi all in the close vicinity.</p><p>The builder is guaranteed to bring a quality living experience to the community of Whitefield Extension in Bidarahalli with brilliant architecture in the nature-themed Carbon Healing Homes and an equivalent lifestyle in Assetz Bloom &amp; Dell.</p><p>Assetz Bloom and Dell Location has excellent connectivity &amp; it is located at the heart of Whitefield Extension in East Bangalore near Kadugodi, Whitefield Main Road, ITPL, Hoodi, Old Madras Road, and more key locations.</p><p>Some of the Amenities at Assetz Bloom &amp; Dell include a fully equipped clubhouse, landscaped gardens, a gymnasium, a swimming pool, recreation rooms, outdoor sports courts, a childrens play area, a party hall, and meticulously planned with utmost importance to state-of-the-art 24/7 securities.</p>',1,13.031881615911653,77.75756840381689,'2024-01-10 05:49:27.722000','2024-01-25 05:36:19.400000','2024-01-10 08:53:41.735000',2,1,NULL,NULL,'Assetz Bloom & Dell','4Y73ZtFK60c','1.78cr-2.36cr','3,4','0','2023-10-31 18:30:00.000000','1839-2396','7.7acres','9675','B + G + 12 Floors','assetz-bloom-and-dell','0','0',17800000,23600000),(29,'<p>Urbanrise The World of Joy Miyapur is a new high-rise luxury residential Apartment project launched in Miyapur, Ameenpur, Hyderabad.</p><p>The residential enclave, Urbanrise The World of Joy Miyapur is a luxury high-rise development in Miyapur near Ameenpur, Hyderabad, and features the very best in Urbanrises luxury living segment. The project offers spacious 3,4 BHK Luxury Apartments with luxurious features and world-class amenities.</p><p>Beautiful landscapes all over and around the massive 12-acre project coupled with over 6 acres of parks, landscapes, and the scenic 100 acres of Ameenpur Lake providing Lakeview all around Urbanrise The World of Joy Miyapur makes it more special &amp; Elite.</p><p>The builder is guaranteed to bring a quality living experience to the community of Miyapur near Ameenpur, North West Hyderabad with brilliant architecture and an equivalent lifestyle in Urbanrise The World of Joy Miyapur with an Elevated Walkway spanning across the towers.</p><p>Urbanrise The World of Joy Miyapur Location has excellent connectivity &amp; it is located at the crux of Miyapur near Ameenpur just 10 mins from Mumbai Highway (Miyapur Road), Nehru Outer Ring Road near existing and upcoming communities &amp; facilities.</p><p>Some of the many Amenities at Urbanrise The World of Joy Miyapur include a fully equipped 1Lakh+ sq. ft clubhouse, landscaped gardens, gymnasium, multiple swimming pools, recreation rooms, outdoor sports courts, childrens play area, the genius learning hub, zen gardens, world-class podium gardens, multipurpose party hall, and meticulously planned utmost importance state-of-the-art 24/7 securities.</p>',1,17.522577876585782,78.34356249206832,'2024-01-10 11:30:58.752000','2024-01-12 09:29:46.875000','2024-01-10 11:52:33.813000',2,2,NULL,NULL,'Urbanrise the world of joy','j4iEdUPGcIw','83.1lac-1.11cr','3,4','0','2023-10-31 18:30:00.000000','1333-1839','12.1 Acers','6234','5 Tower - 42','urbanrise-the-world-of-joy',NULL,NULL,8310000,11100000),(30,'<p>Pacifica Enchante is the new residential luxury villa plots development project launched in Siruseri near SIPCOT IT Park off Old Mahabalipuram Road (OMR), Chennai.</p><p>The massive residential enclave, Enchante by Pacifica plots spans over 25 acres of land &amp; features the very best in Pacifica Companies luxury plotted segment. The project offers spacious Plots ranging from 500sft to 2400sft with premium features and specifications.</p><p>Beautiful landscapes, multiple themed gardens, Thalambur lake nearby, plenty of open spaces, tree-lined avenues, and workspaces of SIPCOT all around Pacifica Enchante Plots make it more special &amp; Elite.</p><p>The builder is guaranteed to bring a quality living experience to the community of Siruseri, just off Old Mahabalipuram Road OMR, South Chennai under 10-15 mins from Thambalur, Navalur, Thaiyur, and Kelambakkam with great architecture and an equivalent lifestyle in Enchante by Pacifica.</p><p>Pacifica Enchante Location has excellent connectivity &amp; it is located at the heart of the Siruseri just off Kelambakkam, OMR, and located right beside the massive TCS Campus in SIPCOT Siruseri IT Park, Polaris, ETA Techno Park &amp; Tech parks near existing and upcoming educational institutions, communities &amp; facilities.</p><p>Some of the premium amenities and USPs at Enchante by Pacifica include an Exquisitely designed layout with entrance, well-paved roads, landscaped gardens, a secured compound, and meticulously planned with utmost importance to state-of-the-art 24/7 securities with the smart plots at Enchante Plots project.</p><p>&nbsp;</p>',1,12.838107117899815,80.20639164521816,'2024-01-11 07:50:14.930000','2024-01-12 09:31:43.919000','2024-01-11 08:16:20.323000',2,2,NULL,NULL,'Pacifica Enchante','zYuNZIw2bzs','30lac-1.02Cr','0','0','2023-10-31 18:30:00.000000','670-2400sq-ft','25 acres','4478','0','pacifica-enchante','670-2400 Sq ft',NULL,3000000,10200000),(31,'<p>Nikoo Homes 6 is the newest phase of the landmark Nikoo Homes project by Bhartiya City launched on Kogilu Main Road, North Bangalore.</p><p>The residential enclave Nikoo 