h Signature Birla architecture designed by renowned architects and an equivalent lifestyle in Birla Advaya RR Nagar.</p><p>Birla Advaya Location has excellent connectivity &amp; it is located at the heart of Rajarajeshwari Nagar just off NICE Road, Outer Ring Road, and Banashankari in West Bangalore.</p><p>Amenities at Birla Advaya RR Nagar include a fully equipped clubhouse lounge, landscaped gardens, gymnasium, swimming pool, recreation rooms, yoga areas, childrens play area, party hall, and meticulously planned with utmost importance state-of-the-art 24/7 security.</p>',1,12.906867970743408,77.50570327301708,'2024-01-11 10:41:22.875000','2024-01-11 15:11:31.137000','2024-01-11 10:54:55.921000',2,2,NULL,NULL,'Birla Advaya',NULL,'67lac-5.4Cr','1,2,3BHK,4BHK villa','0','2023-10-31 18:30:00.000000','600-3800sq-ft','10.5 Acres','11167','33','birla-advaya','0','0',6700000,54000000),(34,'<p>Godrej Sunrise Estate Plots is the new villa plotted development project launched at the heart of Oragadam, Chennai.</p><p>The luxurious residential enclave Sunrise Estate Plots is spread across a massive 60 acres of land and features the very best in Godrej Properties premium plots segment. The project offers spacious Plots ranging from 600sft to 2400sft sizes with luxurious features and a multitude of amenities.</p><p>Beautiful landscapes of 250+ acre wooded forest land all around Godrej Sunrise Estate Plots and open spaces with over 4000 trees make it more special and elite.</p><p>Godrej Properties is a renowned name in Real estate and has offered plotted development all across India. The builder is guaranteed to bring a quality living experience to the community of Oragadam, Chennai with brilliant architecture, and an equivalent lifestyle in Sunrise Estate Plots.</p><p>Godrej Sunrise Estate Plots Location has excellent connectivity &amp; it is located at the crux of Oragadam, the largest upcoming automobile hub in Asia. It is located just off 200 feet Road (Kottamedu Road), Tamba