ghway, 10 mins from Chennai-Vellore Road, and the Porur, Poonamallee junction, close to Bus &amp; Metro stations near existing and upcoming communities &amp; facilities.</p><p>Some of the Amenities at Urbanrise Codename New Porur include a fully equipped gym, clubhouse, landscaped gardens, recreation rooms, outdoor seating areas, childrens play area, party hall, and meticulously planned with utmost importance to state-of-the-art 24/7 securities.</p>',1,13.044560362960185,80.0609452937735,'2024-02-09 10:22:48.599000','2024-02-09 10:23:25.028000','2024-02-09 10:23:25.019000',2,2,NULL,NULL,'Urbanrise Codename New Porur',NULL,' 30.8-47.4 Lacs Onwards','1 BHK,2 BHK,3 BHK','0','2023-10-31 18:30:00.000000','633-1065Sqft ','0','4867','3 Blocks S + 13 Floors','urbanrise-codename-new-porur','7.6 Acres','0',3080000,4740000),(73,'<p>Raghava IRIS is the new landmark high-rise ultra-luxury residential Apartment project launched in Raidurgam, Gachibowli, Hyderabad.</p><p>The residential enclave Raghava IRIS features the very best in Raghava Projects ultra-luxury living segment. The project offers just 4 spacious and opulent 4 BHK Apartments per floor with private elevators with luxurious features.</p><p>Beautiful landscapes, and over 7 acres of lush SkyDeck open green spaces all around Raghava IRIS make it more special &amp; Elite.</p><p>The builder is guaranteed to bring a quality living experience to the community of Raidurgam, Gachibowli, West Hyderabad with brilliant architecture, the first of its kind Sky Deck in India called The Iris Sky Island inspired by Singapores Marina Bay, and an equivalent lifestyle in Raghava IRIS.</p><p>Raghava IRIS Location has excellent connectivity &amp; it is located at the crux of Raidurgam, Gachibowli near existing and upcoming communities &amp; facilities.</p><p>Amenities at Raghava IRIS include a landmark Skydeck on the rooftop of the towers, a fully equipped 5-Storied clubhouse, landscaped gardens, a gymnasium, multiple swimming pools, recreation areas, outdoor sports courts, childrens play areas, party halls, viewing and stargazing decks, and meticulously planned with utmost importance to state-of-the-art 24/7 security.</p>',1,17.423242542440033,78.38908711782766,'2024-02-09 10:56:02.586000','2024-02-09 10:56:11.539000','2024-02-09 10:56:11.516000',2,2,NULL,NULL,'Raghava IRIS',NULL,'7.13- 8.67 Cr','4 BHK + TV Lounge + Maid Room	','0','2023-10-31 18:30:00.000000','5430-6605 Sq.ft	','7.38 Acres','13131','3 Towers 4B + G + 45 Floors','raghava-iris','5430-6605 Sq.ft	','0',71300000,86700000);
